	add("battery", "{\"term\":\"battery\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027batterie\u0027 from Old french (842-ca. 1400) \u0027baterie\u0027 (action of beating) from \u0027batre\u0027 (battre) from Latin {{m|la|battuō||beat}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|right|Electrical batteriesImage:Youghal thumb|right|A cannon batter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A set of electrically connected electrochemical or electrostatic cells (w:Battery Wikipedia\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Act of inflicting unlawful physical violence to a person, legally distinguished from assault which includes the threat of impending violence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Mike Molan, \u0027Modern Criminal Law\u0027, section 7.2.2-3:\u0026lt;!-- 5th ed. p. 221-222 --\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"lt;!--The \u0027mens rea\u0027 for assault requires proof that [the defendant] intended to cause P to apprehend immediate physical violence. [...]--\u0026gt; A \u0027\u0027battery\u0027\u0027 is the actual infliction of unlawful personal violence. [...] [The defendant] fell to the ground and lashed out with his feet and in doing so kicked the hand of one of the police officers, fracturing a bone. He was charged with assault [...] although this was a \u0027\u0027battery\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A coordinated group of artillery weapons\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An elevated platform on which cannon could be placed\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An array of similar things\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Schoolchildren take a \u0027\u0027battery\u0027\u0027 of standard tests to measure their progress\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A set of small cages where hens are kept for the purpose of farming their eggs\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The catcher and the pitcher togethe\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Two or more major pieces on the same rank, file, or diagona\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The state of a firearm when it is possible to be fired\", \"priority\":13}]}, \"synonyms\":{}}");

