	add("battlement", "{\"term\":\"battlement\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027bataillement\u0027 earlier \u0027bastillement\u0027 (fortification) from \u0027bastillier\u0027 (to fortify, to equip with battlements) from \u0027bastille\u0027 (fortress) (see \u0027bastion\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In fortification: an indented parapet, formed by a series of rising members called cops or merlons, separated by openings called crenelles or embrasures, the soldier sheltering himself behind the merlon while he fires through the embrasure or through a loophole in the battlement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any high wall for defense\", \"priority\":2}]}, \"synonyms\":{}}");

